function numberOfPowerfulInt(start: number, finish: number, limit: number, s: string): number {
    let count = 0;
    const sNum = parseInt(s);
    if (sNum < start || sNum > finish) return 0;

    for (let prefix = 0; prefix <= limit; prefix++) {
        let numStr = prefix.toString() + s;
        let num = parseInt(numStr);
        if (num >= start && num <= finish) count++;
        if (prefix === 0) count--; // Remove the case where prefix is 0, as it's just s
    }

    for (let i = 2; i <= s.length; i++) {
        let allPossible = true;
        for (let j = 0; j < i; j++) {
            if (parseInt(s[j]) > limit) {
                allPossible = false;
                break;
            }
        }
        if (allPossible) {
            let multiplier = Math.pow(10, i);
            for (let prefix = 1; prefix <= limit; prefix++) {
                let num = prefix * multiplier + sNum;
                if (num >= start && num <= finish) count++;
            }
        }
    }

    return count;
};
